import React from 'react';
import SoundTile from './SoundTile';

const ForestPage = () => {
  return (
    <div className="page" style={{ backgroundColor: 'green', height: '100vh' }}>
      <SoundTile sound="Rain" />
      <SoundTile sound="Thunder" />
      <SoundTile sound="Birds" />
      <SoundTile sound="River" />
      <SoundTile sound="Wind" />
    </div>
  );
};

export default ForestPage;
